import './Dashboard.css';

function Dashboard(props){

    switch(props.status){
        case 1:
            return(
                <>
                <div id="boardWrapper">
                    <div id="board">
                        No upcoming or ongoing trips
                    </div>
                </div>
                
                </>
            );
        
        // case 2:
        //     return(

        //     );
    }
    return(
        <>
        <div id="boardWrapper">
            <div id="board">
            {props.status}
            </div>
        </div>
        
        </>
    );

}

export default Dashboard;
